(function ( $ ) {
	"use strict";

	$(function () {
   		

   		 $('form#post').on('submit', function(){
            if ($('#_job_location:focus').length){ return false;}
        });

	    var geocoder = new L.Control.Geocoder.Nominatim();
	    var output = [];
	    $("#_job_location").attr('autocomplete', 'off').after('<div id="leaflet-geocode-cont"><ul></ul></div>');

	    $("#_job_location").on("keydown",function search(e) {
            
            if(e.keyCode == 13) {

                var query = $(this).val();
          
                geocoder.geocode(query, function(results) { 
                  
                  for (var i = 0; i < results.length; i++) {
                    
                    output.push('<li data-latitude="'+results[i].center.lat+'" data-longitude="'+results[i].center.lng+'" >'+results[i].name+'</li>');
                  }
                  output.push('<li class="powered-by-osm">Powered by <strong>OpenStreetMap</strong></li>');
                  $("#leaflet-geocode-cont").addClass('active');
                  $('#autocomplete-container').addClass("osm-dropdown-active");
                  $('#leaflet-geocode-cont ul').html(output);
                 
                  output = [];
                });
            }
        });

        $("#job_listing_data").on( "click", "#leaflet-geocode-cont ul li", function(e) {
            
            var newLatLng = new L.LatLng($(this).data('latitude'), $(this).data('longitude'));
            $("#_job_location").val($(this).text());
            
            $("#leaflet-geocode-cont").removeClass('active');
            $('#autocomplete-container').removeClass("osm-dropdown-active");
        });
        
    

		
	});
}(jQuery));


